import React, { Component } from 'react'

import Container from '@material-ui/core/Container';

import Box from '../Components/box';

class Home extends Component {
    constructor() {
        super()
        this.routeProfile = this.routeProfile.bind(this);
        this.routeContact = this.routeContact.bind(this);
        this.routePortfolio = this.routePortfolio.bind(this);
    }
    routeProfile() {
        let path= '/profile';
        this.props.history.push(path);
    }

    routeContact() {
        let path= '/contact'
        this.props.history.push(path)
    }

    routePortfolio() {
        let path= '/portfolio'
        this.props.history.push(path);
    }
    render() {
        return (
<div>
                <h1>Welcome to my Portfolio. Please select one of the buttons below:</h1>
                <Box
                            onClick={this.routeProfile}
                        >Profile</Box>
                <Box 
                            style={{
                                width: '100%',
                                textAlign: "center",
                                justifyContent: "center",
                            }}
                            onClick={this.routeContact}
                        >Contact</Box>
                <Box 
                            style={{
                                width: '100%',
                                textAlign: "center",
                                justifyContent: "center",
                            }}
                            onClick={this.routePortfolio}
                >Portfolio</Box>
            </div>
        )
    }
}

export default Home;
